import React from 'react';
import useWebAnimations, {fadeInLeft} from "@wellyshen/use-web-animations";
import siraamir from './../images/siraamir.jpeg';
import sirameen from './../images/sirameen.jpeg';
import sirmohsin from './../images/sirmohsin.jpeg';
import './home.css';
function Siraamir(){

    const {ref} = useWebAnimations({...fadeInLeft})
    return(
<div className="sir" >
            <img src={siraamir} ref={ref} className="siraamir" alt="siraamir" />
            <img src={sirameen} className="sirameen" alt="sirameen" />
            <img src={sirmohsin} className="sirmohsin" alt="sirmohsin" />

            </div>
    )
}
export default Siraamir;
